import React, { useState } from "react";
import { predictLoan } from "../api";

function Loanform({ setResult }) {
  const [form, setForm] = useState({
    Gender: "Male",
    Married: "No",
    Dependents: "0",
    Education: "Graduate",
    Self_Employed: "No",
    ApplicantIncome: "",
    CoapplicantIncome: "0",
    Loan_Amount_Term: "360",
    Credit_History: "1",
    Property_Area: "Urban",
    DesiredLoanAmount: "",
    LoanType: "Home Loan"
  });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await predictLoan(form);
      setResult(res.data);
    } catch (err) {
      console.error(err.response?.data || err.message);
    }
  };

  return (
    <form onSubmit={handleSubmit} style={{ marginBottom: "2rem" }}>
      <input name="ApplicantIncome" placeholder="Applicant Income" value={form.ApplicantIncome} onChange={handleChange} />
      <input name="CoapplicantIncome" placeholder="Coapplicant Income" value={form.CoapplicantIncome} onChange={handleChange} />
      <input name="Loan_Amount_Term" placeholder="Loan Term (days)" value={form.Loan_Amount_Term} onChange={handleChange} />
      <input name="DesiredLoanAmount" placeholder="Desired Loan Amount" value={form.DesiredLoanAmount} onChange={handleChange} />
      <select name="LoanType" value={form.LoanType} onChange={handleChange}>
        <option>Home Loan</option>
        <option>Car Loan</option>
        <option>Personal Loan</option>
      </select>
      <button type="submit">Check Eligibility</button>
    </form>
  );
}

export default Loanform;
